/*-------------------------------------------------------------------------------------------------+
>>  취소 버튼 클릭 時 처리
+-------------------------------------------------------------------------------------------------*/
function fcInit(obj) {	
    dsOutRaceResult.ClearData();

    dsOutDivRate.ClearData();

    var nRowMap = dsOutDivMap.GetRowCount();
	var nRowIndex;
	var sDataSetID;
	var oDataSet;

	stBefore2.Text = "";
	stBefore1.Text = "";
	stCurrent.Text = "";

	dsOutDivRate_001.FireEvent = false;
	dsOutDivRate_002.FireEvent = false;
	dsOutDivRate_004.FireEvent = false;
	dsOutDivRate_005.FireEvent = false;
	dsOutDivRate_006.FireEvent = false;

	//단승초기화
	dsOutDivRate_001.ClearData();
	//연승초기화
	dsOutDivRate_002.ClearData();
	//쌍승초기화
	dsOutDivRate_004.ClearData();
	//복승초기화
	dsOutDivRate_005.ClearData();
	//삼복승초기화
	dsOutDivRate_006.ClearData();
	//맵핑 테이블 정보
	dsOutDivMap.Sort("DATASET_ID,GRID_ROW", true);

	for (var i = 0; i < nRowMap; i++)
	{
		nRowIndex = dsOutDivMap.GetColumn(i, "GRID_ROW");
		sDataSetID = dsOutDivMap.GetColumn(i, "DATASET_ID");
		oDataSet = object(sDataSetID);

		if (oDataSet.GetRowCount() - 1 < nRowIndex)
			oDataSet.AddRow();
		oDataSet.SetColumn(nRowIndex, dsOutDivMap.GetColumn(i, "COL_TEXT"), dsOutDivMap.GetColumn(i, "RACE_REG_NO_TEXT"));
	}

	dsOutDivRate_001.FireEvent = true;
	dsOutDivRate_002.FireEvent = true;
	dsOutDivRate_004.FireEvent = true;
	dsOutDivRate_005.FireEvent = true;
	dsOutDivRate_006.FireEvent = true;
}

/*-------------------------------------------------------------------------------------------------+
>>  조회 버튼 클릭 時 처리
+-------------------------------------------------------------------------------------------------*/
function fcSearchCheck() {
   if (!fnc_IsMandatory(cboStndYear, "년도")) return false;
   if (!fnc_IsMandatory(cboMbrCd, "경정장")) return false;
   if (!fnc_IsMandatory(cboTMS, "회차")) return false;
   if (!fnc_IsMandatory(cboDayOrd, "일차")) return false;
   if (!fnc_IsMandatory(cboRACE_NO, "경주")) return false;
   if (!fnc_IsMandatory(cboRANK, "선수성적 구분")) return false;
   if (!fnc_IsMandatory(edtRacer, "선수성적")) return false;
   if (!fnc_IsMandatory(edtMotor, "모터(평균 착순점)")) return false;
   if (!fnc_IsMandatory(edtBoat, "보트(평균 착순점)")) return false;
   if (ToNumber(edtRacer.Text) + ToNumber(edtMotor.Text) + ToNumber(edtBoat.Text) != 100)
   {
		fnc_Message(SNIS_BOA_E002, "N");
		return false;
   }
}

//조회 
function fcSearch(obj) {
	if(fcSearchCheck() == false) return;
    //fcInit();

    var sServiceName = "e05030010-service:searchRaceResult";
    var sInDataSet   = "";
    var sOutDataSet  = "dsOutRaceResult=dsOutRaceResult";

    fce_AddParam("STND_YEAR", cboStndYear.Value);
    fce_AddParam("MBR_CD", cboMbrCd.Value);
    fce_AddParam("TMS", cboTMS.Value);
    fce_AddParam("DAY_ORD", cboDayOrd.Value);
    fce_AddParam("RACE_NO", cboRACE_NO.Value);
    fce_AddParam("RACER_RATE_GUBUN", cboRANK.Value);
    fce_AddParam("RACER_RATE", edtRacer.Value);
    fce_AddParam("MOT_RATE", edtMotor.Value);
    fce_AddParam("BOAT_RATE", edtBoat.Value);

	fce_SendTransaction(sServiceName, sInDataSet, sOutDataSet, "fcCallBack");
}

