*                                      사용자 정의  처리 부분                                      *
***************************************************************************************************/
/*-------------------------------------------------------------------------------------------------+
>>  Transaction 후 처리 해야 할 내용!
+-------------------------------------------------------------------------------------------------*/
function fcCallBack(sServiceName, ErrorCode, ErrorMSG) {

	if ( !fnc_result(ErrorCode, ErrorMSG) ) return;

	// 조회 후
	if ( sServiceName == "e05030010-service:searchRaceResult" ) {
	/*
	    if(dsOutRaceResult.GetRowCount() > 0){
			fnc_SetStatus(SNIS_BOA_0003, dsOutRaceResult.GetRowCount());

			dsOutRaceResult.FireEvent = false;
			var nCnt = dsOutRaceResult.rowcount;
			var nTotal;
			for (var i = 0; i < nCnt; i++)
			{
				nTotal = ToNumber(dsOutRaceResult.GetColumn(i, "RACER_SCR")) * ParseInt(edtRacer.Value) / 100 +
						 ToNumber(dsOutRaceResult.GetColumn(i, "MOT_SCR")) * ParseInt(edtMotor.Value) / 100 +
						 ToNumber(dsOutRaceResult.GetColumn(i, "BOAT_SCR")) * ParseInt(edtBoat.Value) / 100 ;

				dsOutRaceResult.SetColumn(i, "TOTAL_SCR", nTotal);
			}
			// 정렬 - 환산점수가 높은 순으로.
			dsOutRaceResult.Sort("TOTAL_SCR", false);
			// 순위셋팅
			for (var i = 0; i < nCnt; i++)
			{
				dsOutRaceResult.SetColumn(i, "RANKING", i + 1);
			}
			// 정렬 - 정번 순으로.
			dsOutRaceResult.Sort("RACE_REG_NO", true);
			dsOutRaceResult.ApplyChange();

			dsOutRaceResult.FireEvent = true;
	    }
	*/
		// 배당율 수신seq가 있을때만 조회
		cboOddSeq.value = trim(cboOddSeq.value);
		if ( !fnc_IsNull(cboOddSeq.value) )	fcSearchRacer();
	}

	// 조회 후
	if ( sServiceName == "e05070010-service:searchDivRate" ) {
	    if(dsOutDivRate.GetRowCount() > 0){
			fnc_SetStatus(SNIS_BOA_0003, dsOutDivRate.GetRowCount());

	    }

	}

	// 회차 리스트 조회시
	if ( sServiceName == "common_race-service:searchRaceTms" ) {
		dsOutSMaxTms.Filter("STND_YEAR='"+cboStndYear.Value+"'&&MBR_CD='"+cboMbrCd.Value+"'");
		var maxTms = dsOutSMaxTms.GetColumn(0,"MAX_TMS");
		dsOutTms.Filter("TMS<=" + maxTms);

        return;
	}
	//오류가 없이 정상 처리되었다면...
	fcPostProcess(sServiceName);
}

