	} else {       
		cboDayOrd.Value = CURR_DAY_ORD;
	}

	fce_GetRace(cboStndYear.Value, cboMbrCd.Value, cboTms.Value, cboDayOrd.Value, "dsOutSRace");
}

//경주번호 DataSet Load 완료 시 
function dsOutSRace_OnLoadCompleted(obj,nErrorCode,strErrorMsg,nReason)
{
	if ( IsExistVar("Arg_sRaceNo") && bPopup ) {
		cboRACE_NO.Value = Arg_sRaceNo;

		bPopup = false;
		fcSearch();
	} else {       
		//cboRACE_NO.Index = 0;
	}

	fcSearchOddSeq();
}

//경주번호 변경시
function cboRACE_NO_OnChanged(obj,strCode,strText,nOldIndex,nNewIndex)
{
	fcSearchOddSeq();
	fcSearch();
}

//수신순서 DataSet Load 완료 시 
function dsOutOddSeq_OnLoadCompleted(obj,nErrorCode,strErrorMsg,nReason)
{
	cboOddSeq.Index = 0;
	var nRowCount = obj.GetRowCount();

	if (nMaxRows == 0)
		nMaxRows = nRowCount;

	if (nMaxRows != nRowCount)
	{
		nMaxRows = nRowCount;
	}

}

function dsOutRacer_OnLoadCompleted(obj,nErrorCode,strErrorMsg,nReason)
{
	var nRow = dsOutRacer.GetRowCount();
	var sRacer;
	var sRank;
	var sRACE_REG_NO;

	if (nRow <= 0) return;
	for (var i = 0; i < nRow; i++)
	{
		sRACE_REG_NO = dsOutRacer.GetColumn(i, "RACE_REG_NO");
		sRank		 = dsOutRacer.GetColumn(i, "RANK");
		sRacer += sRACE_REG_NO + "-" + dsOutRacer.GetColumn(i, "NM_KOR");

		if (sRank != "")
			sRacer += "(" + sRank + "착)";

		if (i < nRow - 1)
			sRacer += ", ";
	}
	stRacer.Text = "출전선수 : " + sRacer;
	fcSearchDivRate();
}

