/*-------------------------------------------------------------------------------------------------+
>>  순위별 색상 처리
+-------------------------------------------------------------------------------------------------*/
function fcSetColor(nRanking){
	var sColor;
	switch (nRanking)
	{
		case 1:
			sColor = "white";
			break;
		case 2:
			sColor = "black";
			break;
		case 3:
			sColor = "red";
			break;
		case 4:
			sColor = "blue";
			break;
		case 5:
			sColor = "yellow";
			break;
		case 6:
			sColor = "green";
			break;
	}
	return sColor;
}


/*-------------------------------------------------------------------------------------------------+
>>  최고정번수에 따른 DsOutDivMap(매핑 데이터셋 변경).
+-------------------------------------------------------------------------------------------------*/
function setDsOutDivMap(){

	setGrid1Size();
	setGrid2Size();

	var maxRegNoCnt = dsOutSRace.GetColumn(cboRACE_NO.Index, "RACE_REG_NO_CNT");

	if(maxRegNoCnt == 7){
		dsOutDivMap.DeleteAll();
		dsOutDivMap.Copy("dsOutDivMap_7");
	}else if(maxRegNoCnt == 8){
		dsOutDivMap.DeleteAll();
		dsOutDivMap.Copy("dsOutDivMap_8");
	}else{
		dsOutDivMap.DeleteAll();
		dsOutDivMap.Copy("dsOutDivMap_6"); // default..
	}


	var nRowMap = dsOutDivMap.GetRowCount();
	var nRowIndex;
	var sDataSetID;
	var oDataSet;

	dsOutDivRate_001.FireEvent = false;
	dsOutDivRate_002.FireEvent = false;
	dsOutDivRate_004.FireEvent = false;
	dsOutDivRate_005.FireEvent = false;
	dsOutDivRate_006.FireEvent = false;

	//단승초기화
	dsOutDivRate_001.ClearData();
	//연승초기화
	dsOutDivRate_002.ClearData();
	//쌍승초기화
	dsOutDivRate_004.ClearData();
	//복승초기화
	dsOutDivRate_005.ClearData();
	//삼복승초기화
	dsOutDivRate_006.ClearData();
	//맵핑 테이블 정보
	dsOutDivMap.Sort("DATASET_ID,GRID_ROW", true);

	for (var i = 0; i < nRowMap; i++)
	{
		nRowIndex = dsOutDivMap.GetColumn(i, "GRID_ROW");
		sDataSetID = dsOutDivMap.GetColumn(i, "DATASET_ID");
		oDataSet = object(sDataSetID);

		if (oDataSet.GetRowCount() - 1 < nRowIndex)
			oDataSet.AddRow();
		oDataSet.SetColumn(nRowIndex, dsOutDivMap.GetColumn(i, "COL_TEXT"), dsOutDivMap.GetColumn(i, "RACE_REG_NO_TEXT"));
	}

	dsOutDivRate_001.FireEvent = true;
	dsOutDivRate_002.FireEvent = true;
	dsOutDivRate_004.FireEvent = true;
	dsOutDivRate_005.FireEvent = true;
	dsOutDivRate_006.FireEvent = true;

}



/*-------------------------------------------------------------------------------------------------+
>>  경주별 최고정번수에 따른 그리드 사이즈 조절
+-------------------------------------------------------------------------------------------------*/
function setGrid1Size(){
	/*
		IWORK_SFR-008 경정 선수편성 메뉴 개선  정번8 까지 추가 수정.
		회차에 따른 최고(8까지)정번수 별로 1 ~ 정번수 까지 화면에 표시.
	*/
	var nMaxTmsRunCnt = 8;
	var nMaxRaceRegNoCnt = -1;

	nMaxRaceRegNoCnt = dsOutSRace.GetColumn(cboRACE_NO.Index, "RACE_REG_NO_CNT");

	if(nMaxRaceRegNoCnt == -1 || fnc_IsNull(nMaxRaceRegNoCnt)) nMaxRaceRegNoCnt = 6;

	//Alert("nMaxRaceRegNoCnt : " + nMaxRaceRegNoCnt);

	Grid1.Redraw = false;

	//전체적으로 사이즈를 넓힘.
	for ( var i = 0; i < nMaxTmsRunCnt; i++ ) {
        Grid1.SetColProp(1 + i, "Width", 40);
    }

    //nMaxTmsRunCnt 부터 nMaxRaceRegNoCnt까지 사이즈를 줄임.
    for ( var i = nMaxTmsRunCnt; i > nMaxRaceRegNoCnt; i-- ) {
        Grid1.SetColProp(1 + i-1, "Width", 0);
    }

    Grid1.SetColProp(0, "Width", 20);

    Grid1.Redraw = true;

    setLocation(nMaxRaceRegNoCnt);
}

function setGrid2Size(){
	/*
		IWORK_SFR-008 경정 선수편성 메뉴 개선  정번8 까지 추가 수정.
		회차에 따른 최고(8까지)정번수 별로 1 ~ 정번수 까지 화면에 표시.
	*/
	var nMaxTmsRunCnt = 8;
	var nMaxRaceRegNoCnt = -1;

	nMaxRaceRegNoCnt = dsOutSRace.GetColumn(cboRACE_NO.Index, "RACE_REG_NO_CNT");

	if(nMaxRaceRegNoCnt == -1 || fnc_IsNull(nMaxRaceRegNoCnt)) nMaxRaceRegNoCnt = 6;

	Grid2.Redraw = false;

	//전체적으로 사이즈를 넓힘.
	for ( var i = 0; i < nMaxTmsRunCnt; i++ ) {
        Grid2.SetColProp(1 + i, "Width", 40);
    }

    //nMaxTmsRunCnt 부터 nMaxRaceRegNoCnt까지 사이즈를 줄임.
    for ( var i = nMaxTmsRunCnt; i > nMaxRaceRegNoCnt; i-- ) {
        Grid2.SetColProp(1 + i-1, "Width", 0);
    }

    Grid2.SetColProp(0, "Width", 20);

    Grid2.Redraw = true;
}



/*-------------------------------------------------------------------------------------------------+
>>  최고정번수에 따른 그리드 사이즈 조절
+-------------------------------------------------------------------------------------------------*/
function setLocation(nMaxRaceRegNoCnt){
	var oriBottom = grdPageList.Bottom;
	var extHeight = 0;
	var rowHeight = 19;
	var rowCnt = nMaxRaceRegNoCnt;
	var gap = 4;

	if(rowCnt < 6) rowCnt = 6;

	// 세로 조절.

	grdPageList.Height = (rowCnt + 1) * rowHeight - 2;

	Shape1.Top = grdPageList.Bottom + gap + 8;
	Static11.Top = grdPageList.Bottom + gap;
	stRacer.Top = grdPageList.Bottom + gap;

	Grid0.Top = Static11.Bottom + gap;
	Grid1.Top = Static11.Bottom + gap;
	Grid2.Top = Static11.Bottom + gap;
	Grid3.Top = Static11.Bottom + gap;
	Grid4.Top = Static11.Bottom + gap;

	Grid0.Height = (rowCnt*3 + 2) * rowHeight;
	Grid1.Height = (rowCnt*3 + 2) * rowHeight;
	Grid2.Height = (rowCnt*3 + 2) * rowHeight;
	Grid3.Height = (rowCnt*3 + 2) * rowHeight - 54;
	Grid4.Height = (rowCnt*3 + 2) * rowHeight;

	stBefore2.Top = Grid3.Bottom + gap + rowHeight;
	stBefore1.Top = Grid3.Bottom + gap + rowHeight;
	stCurrent.Top = Grid3.Bottom + gap + rowHeight;

	btnSearch.Enable = false;
	btnSearch.Enable = true;

	//넓이 조절..
	var wd = 100;

	if(rowCnt > 6){

		if(grdPageList.Width > 1002) return;

		Shape0.Width = Shape0.Width + (wd*2);
		divBtnLst.Left = divBtnLst.Left + (wd*2);
		btnSearch.Left = btnSearch.Left + (wd*2);

		grdPageList.Width = grdPageList.Width + (wd*2);

		Grid2.Width = Grid2.Width + wd;
		Grid1.Left = Grid2.Right + gap;
		Grid1.Width = Grid1.Width + wd;
		Grid3.Left = Grid1.Right + gap;

		stBefore1.Left = stBefore1.Left + (wd*2);
		stBefore2.Left = stBefore2.Left + (wd*2);
		stCurrent.Left = stCurrent.Left + (wd*2);

	}else{

		if(grdPageList.Width == 1002) return;

		Shape0.Width = 1002;
		divBtnLst.Left = 676;
		btnSearch.Left = 954;

		grdPageList.Width = 1002;

		Grid2.Width = 238;
		Grid1.Left = Grid2.Right + gap;
		Grid1.Width = Grid2.Width;
		Grid3.Left = Grid1.Right + gap;

		stBefore1.Left = 775;
		stBefore2.Left = 650;
		stCurrent.Left = 900;

	}
}
